import React from 'react';
import logo from './logo.svg';
import './App.css';

class Welcome extends React.Component {
  render() {
    return <h1>Hello, this website returns random numbers</h1>;
  }
}

class Conclusion extends React.Component {
  render() {
    return <p>Thank you for using this website</p>;
  }
}

function Random() {
  return (
    <div>
      <h2>Random Number: {Math.random}</h2>
    </div>
  );
}

function App() {
  return (
    <div>
      <Welcome />
      <Random />
      <br />
      <Conclusion />
    </div>
  );
}

export default App;
